import React, { Component } from 'react';
import './style/NavBar.css';
import NavBar from './components/NavBar'
import ProductGrid from './components/ProductGrid'


class App extends Component {
  render() {
    return (
      <div id="navbar" style={{ padding: 20 }}>
        <NavBar />
        <ProductGrid />
        <ProductGrid />
      </div>
    );
  }
}

export default App;
